    <script>
        $('#nextfleet').click(function() {
            var checked = $("input[type=checkbox]:checked").length;


            if (!checked) {
                // alert("helo")
                $(".custom_modal").fadeIn("500");
                $(".moda-bg").fadeIn("500");
                return false;
            }

            $('#pricing').removeClass('active');
            $('#fleet').addClass('active');
        })

        $('#nextlookingfor').click(function() {
            var checked = $("input[type=radio]:checked").length;


            if (!checked) {
                $(".custom_modal").fadeIn("500");
                $(".moda-bg").fadeIn("500");
                return false;
            }

            $('#fleet').removeClass('active');
            $('#lookinfor').addClass('active');
        })

        $('#nextvehicletracking').click(function() {
            $('#lookinfor').removeClass('active');
            $('#vehicletracking').addClass('active');
        })

        $('#nextnumemail').click(function() {
            $('#vehicletracking').removeClass('active');
            $('#numemail').addClass('active');
        })
    </script>

    <script>
        $("form#data").submit(function(e) {
            e.preventDefault();
            $('#submit').prop('disabled', true);
            var formData = new FormData(this);
            $.ajax({
                url: "{{ route('finalsub') }}",
                type: 'POST',
                data: formData,
                success: function(data) {
                    // alert();
                    $('#submit').prop('disabled', false);
                    if (data == false) {
                        swal("Please Fill all Fields..!").then(function (){
                            location.reload();
                        });
                    }
                    if(data == true){
                        swal("We have received your inquiry. We will get back to you shortly.").then(function (){
                            location.reload();
                        });
                    }
                },
                cache: false,
                contentType: false,
                processData: false
            });
        });
    </script>

